import React from 'react';
import { ReactComponent as Logo } from './ucm_logo.svg';  // Adjust the path if the SVG is in a different directory
const Nav = ({ onNavigationClick }) => {
    return (


             <nav id="top" style={navbarStyle}>
                    <a href="#top" className="navbar-link">
                        <Logo/>
                        <span>UC Merced Greenhouse</span>
                    </a>

                    <a  style={linkStyle} onClick={() => onNavigationClick('status')} href="#top">Status</a>
                    <a style={linkStyle} onClick={() => onNavigationClick('requestForm')} href="#top">Request Form</a>
            </nav>

    );
}

// Define styles
const navbarStyle = {
    backgroundColor: '#003262',
    overflow: 'hidden',
    height: '80px' /* Set the desired height of the navbar */

    };

const activeLinkStyle = {
    float: 'left',
    display: 'block',
    color: 'black',
    textAlign: 'center',
    padding: '14px 40px',
    textDecoration: 'none',
    backgroundColor: '#003262',
    fontSize: '20px',
    fontWeight: 'bold',
};

const linkStyle = {
    float: 'left',
    display: 'block',
    color: 'black',
    textAlign: 'center',
    padding: '15px 40px',
    textDecoration: 'none',
};



export default Nav;
